#include "csvreader.hpp"

int CSVReader::numOfLines(char *file)
{
    string tempString;
    int numOfLines = 0;
    ifstream myFile(file);
    while (getline(myFile, tempString))
    {
        numOfLines++;
    }
    return numOfLines;
}

CSVReader::CSVReader(char *fileName)
{
    vector<vector<string>>(numOfLines(fileName));
}
